import React from 'react';

function Signup() {
    return ( 
       <div className="container">
        <h2 className="mt-5 text">Signup Account</h2>
        <form>
        <div>
          <label htmlFor="email">Email</label>
          <input
            type="email"
            name="email"
            // value={email}
            placeholder="Enter your email"
            // onChange={handleOnChange}
          />
          </div>
        </form>
       </div>
    );
}

export default Signup;
